description:
Ip Man (2008)  

Hongkong
Actie / Drama
108 minuten

geregisseerd door Wilson Yip
met Donnie Yen, Simon Yam en Siu-Wong Fan

Ip Man is de grote meester van de Wing Chun-stijl van kung fu en de leraar van Bruce Lee. Ip Man's trouw aan Wing Chun, is een klassiek voorbeeld van liefde en respect.

